import{_ as t}from"./chunks/position_fixed.t2m3lWVy.js";import{_ as i,c as a,a8 as r,o as n}from"./chunks/framework.BDnHobkS.js";const f=JSON.parse('{"title":"Return Mode (VTOL)","description":"","frontmatter":{},"headers":[],"relativePath":"ko/flight_modes_vtol/return.md","filePath":"ko/flight_modes_vtol/return.md"}'),o={name:"ko/flight_modes_vtol/return.md"};function l(d,e,s,h,m,u){return n(),a("div",null,e[0]||(e[0]=[r('<h1 id="return-mode-vtol" tabindex="-1">Return Mode (VTOL) <a class="header-anchor" href="#return-mode-vtol" aria-label="Permalink to &quot;Return Mode (VTOL)&quot;">​</a></h1><img src="'+t+'" title="Position fix required (e.g. GPS)" width="30px"><p>The <em>Return</em> flight mode is used to <em>fly a vehicle to safety</em> on an unobstructed path to a safe destination, where it may either wait (hover or circle) or land.</p><p>VTOL vehicles use the <a href="./../flight_modes/return.html#mission-landing-rally-point-return-type-rtl-type-1">Mission Landing/Rally Point</a> return type by default. In this return type a vehicle ascends to a minimum safe altitude above obstructions (if needed), and then flies directly to a rally point or the start of a mission landing point (whichever is nearest), or the home position if neither rally points or mission landing pattern is defined. If the destination is a mission landing pattern, the vehicle will then follow the pattern to land. If the destination is a rally point or the home location, the vehicle will fly back to the home position and land.</p><p>The vehicle will return using the flying mode (MC or FW) it was using at the point when return mode was triggered. Generally it will follow the same return mode behaviour of the corresponding vehicle type, but will always transition to MC mode (if needed) before landing.</p><p>VTOL supports the <a href="./../flight_modes/return.html#return-types-rtl-type">other PX4 return types</a>, including home/rally point return, mission path and closest safe destination. The default type is recommended.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><ul><li>Mode is automatic - no user intervention is <em>required</em> to control the vehicle.</li><li>Mode requires a global 3d position estimate (from GPS or inferred from a <a href="./../ros/external_position_estimation.html#enabling-auto-modes-with-a-local-position">local position</a>). <ul><li>Flying vehicles can&#39;t switch to this mode without global position.</li><li>Flying vehicles will failsafe if they lose the position estimate.</li></ul></li><li>Mode requires home position is set.</li><li>Mode prevents arming (vehicle must be armed when switching to this mode).</li><li>RC 제어 스위치는 기체의 비행 모드를 변경할 수 있습니다.</li><li>RC stick movement is ignored.</li></ul></div><h2 id="technical-summary" tabindex="-1">Technical Summary <a class="header-anchor" href="#technical-summary" aria-label="Permalink to &quot;Technical Summary&quot;">​</a></h2><p>VTOL vehicles use the <a href="./../flight_modes/return.html#mission-landing-rally-point-return-type-rtl-type-1">Mission Landing/Rally Point</a> return type by default, and return using the flying mode (MC or FW) it was using at the point when return mode was triggered.</p><h3 id="fixed-wing-mode-fw-return" tabindex="-1">Fixed-wing Mode (FW) Return <a class="header-anchor" href="#fixed-wing-mode-fw-return" aria-label="Permalink to &quot;Fixed-wing Mode (FW) Return&quot;">​</a></h3><p>If returning as a fixed-wing, the vehicle:</p><ul><li><p>Ascends to a safe minimum return altitude defined by <a href="#RTL_RETURN_ALT">RTL_RETURN_ALT</a> (safely above any expected obstacles). The vehicle maintains its initial altitude if that is higher than the minimum return altitude.</p></li><li><p>Flies via direct constant-altitude path to the destination, which will be the closest of the start of a <em>mission landing pattern</em> and any rally point, or the home location if no mission landing pattern or rally points are defined.</p></li><li><p>목적지가 임무 착륙 패턴인 경우 패턴을 따라 착륙합니다.</p><p>A mission landing pattern for a VTOL vehicle consists of a <a href="https://mavlink.io/en/messages/common.html#MAV_CMD_DO_LAND_START" target="_blank" rel="noreferrer">MAV_CMD_DO_LAND_START</a>, one or more position waypoints, and a <a href="https://mavlink.io/en/messages/common.html#MAV_CMD_NAV_VTOL_LAND" target="_blank" rel="noreferrer">MAV_CMD_NAV_VTOL_LAND</a>.</p></li><li><p>If the destination is a rally point or home it will:</p><ul><li><p>Loiter/spiral down to <a href="#RTL_DESCEND_ALT">RTL_DESCEND_ALT</a>.</p></li><li><p>Circle for a short time, as defined by <a href="#RTL_LAND_DELAY">RTL_LAND_DELAY</a>.</p></li><li><p>Yaw towards the destination (centre of loiter).</p></li><li><p>Transition to MC mode and land.</p><p>Note that <a href="./../advanced_config/parameter_reference.html#NAV_FORCE_VT">NAV_FORCE_VT</a> is ignored: the vehicle will always land as a multicopter for these destinations.</p></li></ul></li></ul><h2 id="multicopter-mode-mc-return" tabindex="-1">Multicopter Mode (MC) Return <a class="header-anchor" href="#multicopter-mode-mc-return" aria-label="Permalink to &quot;Multicopter Mode (MC) Return&quot;">​</a></h2><p>If returning as a multicopter:</p><ul><li>The behaviour is the same except that the vehicle flies as a multicopter and respects multicopter settings.</li><li>In particular, if landing on rally point or the home position the vehicle uses the <a href="#RTL_CONE_ANG">RTL_CONE_ANG</a> instead of just the <a href="#RTL_RETURN_ALT">RTL_RETURN_ALT</a> for defining the minimum safe return altitude. For more information see the explanation of the &quot;cone&quot; in <a href="./../flight_modes/return.html#minimum-return-altitude">Return mode (Generic Vehicle) &gt; Minimum Return Altitude</a>.</li></ul><h2 id="매개변수" tabindex="-1">매개변수 <a class="header-anchor" href="#매개변수" aria-label="Permalink to &quot;매개변수&quot;">​</a></h2><p>The RTL parameters are listed in <a href="./../advanced_config/parameter_reference.html#return-mode">Parameter Reference &gt; Return Mode</a>. If using a mission landing, only the <a href="#RTL_RETURN_ALT">RTL_RETURN_ALT</a> and <a href="#RTL_DESCEND_ALT">RTL_DESCEND_ALT</a> are relevant. The others are relevant if the destination is a rally point or the home location.</p><table tabindex="0"><thead><tr><th>매개변수</th><th>설명</th></tr></thead><tbody><tr><td><a id="RTL_TYPE"></a><a href="./../advanced_config/parameter_reference.html#RTL_TYPE">RTL_TYPE</a></td><td>Return type.</td></tr><tr><td><a id="RTL_RETURN_ALT"></a><a href="./../advanced_config/parameter_reference.html#RTL_RETURN_ALT">RTL_RETURN_ALT</a></td><td>Return altitude in meters (default: 60m)If already above this value the vehicle will return at its current altitude.</td></tr><tr><td><a id="RTL_CONE_ANG"></a><a href="./../advanced_config/parameter_reference.html#RTL_CONE_ANG">RTL_CONE_ANG</a></td><td>기체 RTL 리턴 고도를 정의하는 원뿔의 반각. 값 (도) : 0, 25, 45, 65, 80, 90. Note that 0 is &quot;no cone&quot; (always return at <code>RTL_RETURN_ALT</code> or higher), while 90 indicates that the vehicle must return at the current altitude or <code>RTL_DESCEND_ALT</code> (whichever is higher).</td></tr><tr><td><a id="RTL_DESCEND_ALT"></a><a href="./../advanced_config/parameter_reference.html#RTL_DESCEND_ALT">RTL_DESCEND_ALT</a></td><td>기체가 더 높은 복귀 고도에서 감속하거나 초기 하강을 중지할 최소 복귀 고도 및 고도 (기본값 : 30m)</td></tr><tr><td><a id="RTL_LAND_DELAY"></a><a href="./../advanced_config/parameter_reference.html#RTL_LAND_DELAY">RTL_LAND_DELAY</a></td><td>Time to hover at <code>RTL_DESCEND_ALT</code> before landing (default: 0.5s) -by default this period is short so that the vehicle will simply slow and then land immediately. If set to -1 the system will loiter at <code>RTL_DESCEND_ALT</code> rather than landing. 이 지연은 랜딩 기어가 배치될 시간을 설정합니다. (자동으로 동작함).</td></tr><tr><td><a id="RTL_LOITER_RAD"></a><a href="./../advanced_config/parameter_reference.html#RTL_LOITER_RAD">RTL_LOITER_RAD</a></td><td>[Fixed-wing Only] The radius of the loiter circle (at <a href="#RTL_LAND_DELAY">RTL_LAND_DELAY</a>.</td></tr><tr><td><a id="MIS_TKO_LAND_REQ"></a><a href="./../advanced_config/parameter_reference.html#MIS_TKO_LAND_REQ">MIS_TKO_LAND_REQ</a></td><td>Specify whether a mission landing or takeoff pattern is <em>required</em>. Generally fixed-wing vehicles set this to require a landing pattern but VTOL do not.</td></tr></tbody></table><h2 id="see-also" tabindex="-1">See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;See Also&quot;">​</a></h2><ul><li><a href="./../flight_modes/return.html">Return Mode (Generic)</a></li><li><a href="./../flight_modes_mc/return.html">Return Mode (Multicopter)</a></li><li><a href="./../flight_modes_fw/return.html">Return Mode (Fixed-Wing)</a></li></ul>',20)]))}const p=i(o,[["render",l]]);export{f as __pageData,p as default};
